import { Box, Grid, Typography, Paper } from '@material-ui/core';

function Login(): JSX.Element {
    return (
        <Grid container>
            <Grid item component={Paper}>
                <Box>
                    <Typography>Sign in</Typography>
                </Box>
            </Grid>
        </Grid>
    )
  }

export default  Login;
